import React, {Component} from 'react';
import logo from './Blog-Logo.svg'
import './Nav.css'


class Nav extends Component {

  render(){
    const {onChange} = this.props  
    return(
      <nav>
        <img src={logo} alt="Blog-Logo"/>
        <ul>
          <li><a className="link" onClick={() => onChange('main')} href="#1">文章列表</a></li>
          <li><a className="link" onClick={() => onChange('main')} href="#2">作品集</a></li>
          <li><a className="link" onClick={() => onChange('main')} href="#3">關於我</a></li>
        </ul>
        <div id="myAccount"> </div>
      </nav>
    )
  }
}


export default Nav
